@AryeErlich איפה אתה ממוקם בכל התכניות ?

״האח הגדול כנסת ישראל״ , עונה 26 נמצאת כעת במהלכים אחרונים לפני הישורת האחרונה של הבחירות / רייטינג / עבודה על עם ישראל בעיניים. 

אין מישהו מהקאסט שנמצא כרגע בכנסת למעלה למעלה, שלא מבין ויודע שהצופים בבית פשוט תמימים שלא מבינים איך המציאות מתנהלת.

@nt45316003 תכנית ״האח הגדול כנסת ישראל״ עונה 26 יצאה לדרך. 

יש שינוי קל בקאסט המועמדים שיכנסו לוילה השנה, הפרשנים קצת שינו אולפנים וצוות ההפקה שאין לנו מושג מי הם? בעמדת השליטה בדיוק כפי כל העונות. 

